import { Component, OnInit } from '@angular/core';
import { vrInfo } from 'src/vrInfo';
import { HEADSETS } from '../mock-vrInfo';

@Component({
  selector: 'app-vrinfo',
  templateUrl: './vrinfo.component.html',
  styleUrls: ['./vrinfo.component.css']
})
export class VRInfoComponent implements OnInit {

  vrinfo1: vrInfo ={
    id: 0,
    ipAdress: '10.0.0.1',
    port: "8001",
    name: 'VR1',
    currentStatusEnum: 'FazerEnum'
  }

  headsets = HEADSETS; 

  ngOnInit(): void {
  }

  sendOSC() {
    fetch("http://localhost:3000/VRHeadsets");
    //http://localhost:3000/DownloadAssets/VR1
  }

}
<h1> {{ vrinfo1.name }} Headset added</h1>


<div>
    <label for="">Name: </label>
    <input type= "text" [(ngModel)] ="vrinfo1.name"> <!--Two way data-binding-->
    <br>
    <label for="">IpAdress: </label>
    <input type= "text" [(ngModel)] ="vrinfo1.ipAdress"> 
    <br>
    <label for="">Port: </label>
    <input type= "text" [(ngModel)] ="vrinfo1.port"> 
    <br>
    <label for="">Status: </label>
    <input type= "text" [(ngModel)] ="vrinfo1.currentStatusEnum"> 

    <br>
    <button (click)="sendOSC()"> Click me for OSC Message to {{ vrinfo1.name }}</button>


</div>
